import React from 'react';

function Info() {
    return (<>
        <p>These are the citites of the Pakistan</p>
        <ol>
            <li>Karachi</li>
            <li>Lahore</li>
            <li>Islamabad</li>
            <li>Hyderabad</li>
            <li>Quetta</li>
            <li>Peshawar</li>
        </ol>
    </>);
}

export default Info;
